import subprocess

def execute_command(cmd, expect_exit_code=0):
    result = subprocess.run(cmd, shell=True, capture_output=True, check=False)
    if expect_exit_code and result.returncode != expect_exit_code:
        print(f'Command {cmd} failed ❌ with stdout {result.stdout} and exception {result.stderr}')
        raise ValueError(f'Command {cmd} failed ❌ with stdout {result.stdout} and exception {result.stderr}')
    print(f'Executed command {cmd}')
    return result

import json

fx = []

result = json.loads(execute_command(f'gh pr list --limit 1000 --author googlyrahman --json url').stdout.decode('utf-8'))
for dc in result:
    pr_num = int(dc['url'].rsplit('/', 2)[-1])
    print(pr_num)
    paths = execute_command(f'gh pr diff {pr_num} --name-only').stdout.decode('utf-8').splitlines()
    fx.extend(paths)

for elem in fx:
    print(f'/usr/local/google/home/margubur/git_migration/projects/git-training-data-analyst/{elem},PASS')

